import * as React from "react";
import { ContactsList } from "./ContactsList";
import { AppHeader } from "./AppHeader";

export class App extends React.Component {
  state = {
    FoodProductModel: null
  };

  componentDidMount() {
    fetch("http://chamniam.pl/api/foodproduct")
      .then(res => res.json())
      .then(json => this.setState({ FoodProductModel: json.results }));
  }

  render() {
    const FoodProductModel = this.state.contacts;
    console.log("start");
    console.log(FoodProductModel);
    console.log("contacts");
    return (
      <div>
        <AppHeader />
        <main className="ui main text container">
          {FoodProductModel ? <ContactsList contacts={FoodProductModel} /> : 'Ładowanie…'}
        </main>
      </div>
    );
  }
}
